import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
        <React.Fragment>
            <Header/>
        </React.Fragment>
    );
  }
}

const Header: React.SFC = () => {
    <div>
        <p>Hello, this is Lica`s movie app</p>
    </div>
}

export default App;
